import { productsList } from "../../assets/data/dataProducts";

export default function ProductCard() {
    const dataProducts = productsList.map(value =>
    
        <div class="container md-auto text-centrer" key={value.id}>
            <div class="bg-gray-300 h-44 rounded-t-3xl">
                {/* IMG */}
            </div>
            <div class="py-6 px-4">
                <div>
                    <h3 class="font-bold text-2xl pb-2">{value.title}</h3>
                    <p class="pb-2 text-gray-500">{value.description}</p>
                </div>
                <div class="flex items-end float-right text-slate-600 font-bold">
                    <p class="text-xl">{value.currency}</p>
                    <p class="text-2xl">{value.price}</p>
                </div>
            </div>
        </div>
    );
    return dataProducts;
};
